import './index.css'

const CardItem = props => {
  const {cardObject} = props
  const {title, description, imgUrl, className} = cardObject
  return (
    <li class={`${className}`}>
      <h1>{title}</h1>
      <p>{description}</p>
      <img src={imgUrl} alt={title} />
    </li>
  )
}

export default CardItem
